import './ExpenseDate.css';

const ExpenseDate = ({ data }) => {
  const monthFormat = data.toLocaleString("it-IT", { month: "long" });
  const dayFormat = data.toLocaleString("it-IT", { day: "2-digit" });
  const yearFormat = data.toLocaleString("it-IT", { year: "numeric" });

  return (
    <div className="expense_data col-2">

      <div>{monthFormat}</div>
      <div>{dayFormat}</div>
      <div>{yearFormat}</div>
    </div>
  );
};

export default ExpenseDate;
